lens_3.query:
q = load "${App.Datasets.Acc360_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate trunc( ( sum('DevicesUsage') / ( sum('DevicesLeft') + sum('DevicesUsage') ) ) * 100, 2) as 'Percent';
q = limit q 2000;

lens_4.query:
q = load "${App.Datasets.CarDetails_tp.FullyQualifiedName}";
q = filter q by date('AppDate_Year', 'AppDate_Month', 'AppDate_Day') in [dateRange([2020,1,1], [2020,7,30])];
q = group q by ('AppDate_Year', 'AppDate_Week');
q = foreach q generate 'AppDate_Year' + "~~~" + 'AppDate_Week' as 'AppDate_Year~~~AppDate_Week', avg('DeviceUsage') as 'avg_DeviceUsage';
q = order q by 'AppDate_Year~~~AppDate_Week' asc;
q = limit q 2000;
